/*
 * Table accessor.
 */
unsigned long
idn__sparsemap_getlowercase(unsigned long v) {
	int idx0, idx1, idx2;

	if (v > UTF32_MAX)
		return (0);
	idx0 = v >> (LOWERCASE_BITS_1 + LOWERCASE_BITS_2);
	idx1 = (v >> LOWERCASE_BITS_2) & ((1 << LOWERCASE_BITS_1) - 1);
	idx2 = v & ((1 << LOWERCASE_BITS_2) - 1);
	return (unsigned long) lowercase_table[lowercase_imap[lowercase_imap[idx0] + idx1]].tbl[idx2];
}

